import React from "react";
import {roundSeparateNumber} from "../../../common/utils";

import {useDispatch, useSelector} from "react-redux";


const ItemTableWalletCurrency = ({currency, index}) => {
        const dispatch = useDispatch();
        const {assets24h, details, isOpen} = useSelector(state => state.details);

        const price = roundSeparateNumber(currency.priceUsd);
        const summary = roundSeparateNumber(currency.priceUsd * 1);

        return (
            <>
                <tr >
                    <td>{index}</td>
                    <td>{currency.name}</td>
                    <td>${currency.price}</td>
                    <td>{currency.count}</td>
                    <td>${currency.summary}</td>
                    <td>-</td>
                </tr>

            </>
        );
    }
;

export default ItemTableWalletCurrency;
